    def init_arr(self):
        arr = []
        temp = []
        for i in range(1, 82):
            temp.append(self.lineEdit[i - 1].text())
            if i % 9 == 0:
                arr.append(temp)
                temp = []
        return arr

    def onButtonCal(self):
        solution = sudoku.Solve(self.init_arr())
        array = solution.solve()
        print(array)
        for i in range(9):
            if '' in array[i]:
                self.textBrowser.setText('无解')
                return

        for i in range(9):
            for j in range(9):
                self.lineEdit[i * 9 + j].setText(array[i][j])
        self.textBrowser.setText('完成')

    def onButtonClear(self):
        for i in range(81):
            self.lineEdit[i].setText('')
